{
  id: 'mapToObjectArray',
  inputs: ['map'],
  outputs: ['array'],
  fn: async (inputs, outputs) => {
    const { map } = inputs;
    const { array } = outputs;
    const objectArray = Array.from(map.values());
    array.value = objectArray;
  },
},
