{
  id: 'filterObjectsWithoutId',
  inputs: ['array'],
  outputs: ['filteredArray'],
  fn: async (inputs, outputs) => {
    const { array } = inputs;
    const { filteredArray } = outputs;
    const filtered = array.value.filter((obj) => obj.id !== undefined);
    filteredArray.value = filtered;
  },
}
